window.bookSummaryJSON = "<p><i>Queen </i>is the climactic conclusion to <i>New York Times</i> best-selling author Timothy Zahn's thrilling space adventure series, the Sybil's War. </p> <p>Nicole Hammond is a Sibyl, a special human that has the ability to communicate with a strange alien ship called the <i>Fyrantha</i>. </p> <p>However, Nicole and all other sentient creatures are caught up in a war for control between two competing factions. Now, the street kid turned rebel leader has a plan that would restore freedom to all who have been shanghaied by the strange ship. </p> <p>She just has to unite the many alien races being forced to combat for their freedom, dodge slaving war profiteers determined to capture her, and convince an AI at war with itself to trust her above all else.</p>"; 
